pragma solidity 0.5.10;

import "@gnosis.pm/safe-contracts/contracts/GnosisSafe.sol";

// Option A: Inheritance solution with initiatorSig parameter
// no success return, contracts can't be initiator, partly duplicated code 
// other owner don't know who the initiator will be

contract ExtendedGnosisSafeA is GnosisSafe {

    mapping(address => bool) public onlyApprover;

    function execTransactionWithApprover(
        address to,
        uint256 value,
        bytes calldata data,
        Enum.Operation operation,
        uint256 safeTxGas,
        uint256 baseGas,
        uint256 gasPrice,
        address gasToken,
        address payable refundReceiver,
        bytes calldata initiatorSig,
        bytes calldata signatures
    )
        external
    {

        bytes32 txHash = checkTx(
            to,
            value,
            data,
            operation,
            safeTxGas,
            baseGas,
            gasPrice,
            gasToken,
            refundReceiver,
            signatures
        );

        checkInitiator(initiatorSig, txHash);

        initExecution(
            to,
            value,
            data,
            operation,
            safeTxGas,
            baseGas,
            gasPrice,
            gasToken,
            refundReceiver,
            txHash
        );
    }

    function checkTx(
        address to,
        uint256 value,
        bytes memory data,
        Enum.Operation operation,
        uint256 safeTxGas,
        uint256 baseGas,
        uint256 gasPrice,
        address gasToken,
        address payable refundReceiver,
        bytes memory signatures
    )
        internal
        returns (bytes32 txHash)
    {
        bytes memory txHashData = encodeTransactionData(
            to, value, data, operation, // Transaction info
            safeTxGas, baseGas, gasPrice, gasToken, refundReceiver, // Payment info
            nonce
        );
        // Increase nonce and execute transaction.
        nonce++;
        txHash = keccak256(txHashData);
        checkSignatures(txHash, txHashData, signatures, true);
    }

    function initExecution(
        address to,
        uint256 value,
        bytes memory data,
        Enum.Operation operation,
        uint256 safeTxGas,
        uint256 baseGas,
        uint256 gasPrice,
        address gasToken,
        address payable refundReceiver,
        bytes32 txHash
    )
        internal
        returns (bool success)
    {
        require(gasleft() >= safeTxGas, "Not enough gas to execute safe transaction");
        // Use scope here to limit variable lifetime and prevent `stack too deep` errors
        {
            uint256 gasUsed = gasleft();
            // If no safeTxGas has been set and the gasPrice is 0 we assume that all available gas can be used
            success = execute(to, value, data, operation, safeTxGas == 0 && gasPrice == 0 ? gasleft() : safeTxGas);
            gasUsed = gasUsed.sub(gasleft());
            // We transfer the calculated tx costs to the tx.origin to avoid sending it to intermediate contracts that have made calls
            uint256 payment = 0;
            if (gasPrice > 0) {
                payment = handlePayment(gasUsed, baseGas, gasPrice, gasToken, refundReceiver);
            }
            if (success) emit ExecutionSuccess(txHash, payment);
            else emit ExecutionFailure(txHash, payment);
        }
    }

    function handlePayment(
        uint256 gasUsed,
        uint256 baseGas,
        uint256 gasPrice,
        address gasToken,
        address payable refundReceiver
    )
        private
        returns (uint256 payment)
    {
        // solium-disable-next-line security/no-tx-origin
        address payable receiver = refundReceiver == address(0) ? tx.origin : refundReceiver;
        if (gasToken == address(0)) {
            // For ETH we will only adjust the gas price to not be higher than the actual used gas price
            payment = gasUsed.add(baseGas).mul(gasPrice < tx.gasprice ? gasPrice : tx.gasprice);
            // solium-disable-next-line security/no-send
            require(receiver.send(payment), "Could not pay gas costs with ether");
        } else {
            payment = gasUsed.add(baseGas).mul(gasPrice);
            require(transferToken(gasToken, receiver, payment), "Could not pay gas costs with token");
        }
    }

    function swapOwner(address prevOwner, address oldOwner, address newOwner)
        public
        authorized
    {
        super.swapOwner(prevOwner, oldOwner, newOwner);
        onlyApprover[newOwner] = onlyApprover[oldOwner];
        onlyApprover[oldOwner] = false;

    }

    function addApproverWithThreshold(address approver, uint256 _threshold)
        public
        authorized
    {
        onlyApprover[approver] = true;
        super.addOwnerWithThreshold(approver, _threshold);
    }

    function removeOwner(address prevOwner, address owner, uint256 _threshold)
        public
        authorized
    {
        super.removeOwner(prevOwner, owner, _threshold);
        onlyApprover[owner] = false;
    }

    function checkInitiator(bytes memory initiatorSignature, bytes32 txHash)
        internal
    {
        uint8 v;
        bytes32 r;
        bytes32 s;
        (v, r, s) = signatureSplit(initiatorSignature, 0);
        address calcedInitiator;
        if (v > 30) {
            // To support eth_sign and similar we adjust v and hash the messageHash with the Ethereum message prefix before applying ecrecover
            calcedInitiator = ecrecover(keccak256(abi.encodePacked("\x19Ethereum Signed Message:\n32", txHash, "initiator")), v - 4, r, s);
        } else {
            // Use ecrecover with the messageHash for EOA signatures
            calcedInitiator = ecrecover(keccak256(abi.encodePacked(txHash, "initiator")), v, r, s);
        }

        require (
            onlyApprover[calcedInitiator] == false && owners[calcedInitiator] != address(0) && calcedInitiator != SENTINEL_OWNERS,
            "Invalid initiator provided"
        );

    }

}
